import React from "react";
import TodoItemContainer from "../todo-item/Todo-item-container";
import {Loader} from "../loader/Loader"
import "./todo-list.css";

export const TodoList = ({loader, alert, isEmpty, todoList}) => {
    return (alert ?
            // <div className="alert alert-danger" role="alert">
            //     A simple danger alert—check it out!
            // </div>
            <img src="https://storage.whmcs.community/monthly_2018_07/Capture.PNG.7a51e2102a5730e3ce96674d49bddf8c.PNG" alt="img"/>
        : loader ?
            <Loader/>
        : isEmpty ?
        <div className="todo-list">
            <ul className="collection with-header">
                {todoList.map(todo => <TodoItemContainer todo={todo} key={todo.id}/>)}
            </ul>
        </div>
        :
        <div className="row">
            <div className="col s12 m5">
                <div className="card-panel teal">
                    <span className="white-text no-todo">This to-do list is empty.</span>
                </div>
            </div>
        </div>
    )
};
